const CartOrderForm = () => {
  return (
    <form>
      <div>
        <label htmlFor={props.input.id}>Your Name</label>
        <input />
      </div>
      <div>
        <label htmlFor={props.input.id}>Street</label>
        <input />
      </div>
      <div>
        <label htmlFor={props.input.id}>Postal Code</label>
        <input />
      </div>
      <div>
        <label htmlFor={props.input.id}>City</label>
        <input />
      </div>
    </form>
  );
};

export default CartOrderForm;
